import React, { Component } from 'react';
import './index.scss'

import './index.scss'

export default class index extends React.Component {
    state = {
        isShow:"true"
    }

    componentDidMount() {
        this.setState({
            isShow: String.toString(this.props.isShow)
        })
    }

    render() {
        const isShow = this.state
        console.log(typeof(isShow))
        console.log(isShow === "true")
        return (
            <div class="box" style={isShow === true ? {display:"flex"}:{display:"none"}}>
                <div class="cat">
                    <div class="cat__body"></div>
                    <div class="cat__body"></div>
                    <div class="cat__tail"></div>
                    <div class="cat__head"></div>
                </div>
            </div>
        )
    }
}
